import React from "react";

class Users extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    if (this.users.length > 0)
      return (
        <div>
          {this.users.map((el) => (
            <div className="user" key={el.id}>
              <h3>
                {el.firstname} {el.lastname}
              </h3>
              <p>{el.bio}</p>
              <b>{el.isHappy ? "happy:)" : "not much:("}</b>
            </div>
          ))}
        </div>
      );
    else
      return (
        <div className="user">
          <h3>there're no users</h3>
        </div>
      );
  }
}

export default Users;
